import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import Spinner from '../../Utils/Spinner';
import { useParams } from "react-router";

function ActuacionesMigracionLista() {

    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
    const [getListaActuaciones, setListaActuaciones] = useState({ data: [], links: [], meta: [] });

    let { radicado, vigencia} = useParams();


    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            listaActuaciones();
            
           
        }
        fetchData();
    }, []);


    const listaActuaciones= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-lista-actuaciones/"+radicado+"/"+vigencia).then(
                datos => {

                    if (!datos.error) {
                        setListaActuaciones(datos);

                    } else {
                        //setModalState({ title: "MigraciÃ³n Datos del interesado", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }

    const colorFase = (estado_fase) => {

        if (estado_fase === 1)
          return (global.Constants.SEMAFORIZACION_FASES.RED)
        else if (estado_fase === 2)
          return (global.Constants.SEMAFORIZACION_FASES.ORANGE)
        else
          return (global.Constants.SEMAFORIZACION_FASES.GREEN)
    }

    const lista = () => {

        if (getListaActuaciones.data != null && typeof (getListaActuaciones.data) != 'undefined') {
            return (

                getListaActuaciones.data.map((item, i) => {
                    return (
                        <tr>
                            <td>{i=i+1}</td>
                            <td>{item.attributes.nombre}</td>
                            <td>{item.attributes.tipo}</td>
                            <td width="40%">{item.attributes.autoNumero}</td>
                            <td><Link className="text-dark" to={`/CargarMigracionActuacion/${radicado}/${vigencia}/${item.attributes.id}`}>
                                <button type="button" className="btn btn-sm btn-secundary w2d_btn-large mr-1 mb-3 text-left">
                                    <i className={colorFase(item.attributes.semaforizacion)}></i> Completar informaciÃ³n
                                </button></Link>
                            </td>
                        </tr>
                    )
                })
            )
        }
    }


    return (
        <>
            {<Spinner />}   
            {<ModalGen data={getModalState} />}
          
            <div className="w2d_block">
                <nav aria-label="breadcrumb">
                    <ol className="breadcrumb breadcrumb-alt push">
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/Buscador`}><small>Buscador</small></Link></li>
                        <li class="breadcrumb-item"> <Link underline="hover" className="text-dark" to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`}><small>Inicio proceso de migraciÃ³n</small></Link></li>
                        <li class="breadcrumb-item"> <small>Lista de actuaciones</small></li>
                    </ol>
                </nav>
            </div>

            <div className="block block-themed">
                <div className="block-header">
                    <h3 className="block-title">Proceso disciplinario :: {radicado} - {vigencia} Fase: Actuaciones</h3>
                </div>

                <div className="block-content">
                    
                    <div className="col-md-12">

                   
                        <div className='text-right w2d-enter'>                                
                            <Link to={`/ProcesoDisciplinarioMigracion/${radicado}/${vigencia}`} title='Regresar' >
                                <button type="button" className="btn btn-success"><i className="fas fa-backward"></i> </button>
                            </Link>
                        </div>   

                        {getListaActuaciones.data.length==0?

                            <div class="alert alert-warning alert-dismissable" role="alert">
                                <h3 class="alert-heading font-size-h4 my-2">Alerta</h3>
                                <p class="mb-0">No existen actuaciones registradas en el sistema de migraciÃ³n para este proceso disciplinario.</p><br/>
                                <p class="mb-0"><strong>Nota: </strong> las actuaciones no son obligatorias para llevar a cabo la migraciÃ³n del proceso.</p>
                            </div>
                            :
                            <table class="table">
                                <thead>
                                    <tr>
                                        <th scope="col">#</th>
                                        <th scope="col">Nombre</th>
                                        <th scope="col">Tipo</th>
                                        <th scope="col">NÃºmero de auto</th>
                                        <th scope="col">Acciones</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {lista()}                 
                                </tbody>
                            </table>

                        }
                        
                    </div>
                </div>
                
            </div>

                   
        </>
    );
}


export default ActuacionesMigracionLista;
